import React from 'react';

const Events = () => {
return (
	<div
	style={{
		display: 'flex',
		justifyContent: 'Right',
		alignItems: 'Right',
		height: '100vh'
	}}
	>
	<table>
		<tr>
			<td>World Film Festival</td>
			<td>June 1, 2023 - June 22, 2023</td>
		</tr>
	</table>
	</div>
);
};

export default Events;
